import React from 'react';
import { View } from 'react-native';

type FrameProps = {
    size: number
}

const SquareContainer = (props: FrameProps) => {
    return (
        <View style={{
            position: 'absolute',
            top: 20,
            left: 20,
            width: props.size,
            height: props.size,
            backgroundColor: 'red'
        }}>
        </View>
    );
};

export default SquareContainer;
